import React, { Component } from 'react';
import {Route, NavLink, Switch} from "react-router-dom";
import Home from './pages/home';

import Nav from './components/navbar/navbar';
import Fam from './components/email/join';
import Foot from './components/footer/sponsor';

import About from './pages/about/about';
import Rules from './pages/rules/rules';
import Regi from './pages/register/register';
import Events from './pages/events/events';
import Pricing from './pages/pricing/pricing';
import Pay from './pages/payment/payment';

import './App.css';

function App() {
  return (
    <div className="App">

      <body>
          {/*Navigation*/}
          <Nav />

          <Switch>

            {/*Routes for Different Pages*/}

            <Route className="slide-trans" exact path="/" component={Home} />
            <Route className="slide-trans" exact path="/About" component={About} />
            <Route className="slide-trans" exact path="/Rules" component={Rules} />
            <Route className="slide-trans" exact path="/Register" component={Regi} />
            <Route className="slide-trans" exact path="/Events" component={Events} />
            <Route className="slide-trans" exact path="/Classes" component={Pricing} />
            <Route className="slide-trans" exact path="/Payment" component={Pay} />

          </Switch>

          {/*Email and Footer*/}
          <Fam />
          <Foot />
      </body>

    </div>
  );
}

export default App;
